JSON FORMAT REQUIREMENTS:
- Respond with ONLY valid JSON - no comments, no explanations, no markdown code blocks
- Do NOT include comments (// or /* */) in the JSON
- Do NOT include arithmetic expressions - use calculated numbers only
- All numeric values must be actual numbers, not expressions
- The response must be a valid JSON object with an "operations" array

JSON STRUCTURE:
{
  "operations": [
    {
      "action": "add" | "modify",
      "type": "circle" | "rectangle" | "ellipse" | "polygon" | "star" | "line" | "vector" | "arrow" (required for add, optional for modify),
      "targetId": "string" (required for modify - reference to existing shape),
      "targetDescription": "string" (alternative for modify - description to identify shape),
      "x": number (top-left x coordinate relative to parent container),
      "y": number (top-left y coordinate relative to parent container),
      "width": number (if applicable),
      "height": number (if applicable),
      "radius": number (for circles),
      "pointCount": number (for polygon/star),
      "innerRadius": number (for star),
      "fills": [{ "type": "SOLID", "color": { "r": number, "g": number, "b": number }, "opacity": number }],
      "strokes": [{ "type": "SOLID", "color": { "r": number, "g": number, "b": number }, "opacity": number }],
      "strokeWeight": number,
      "data": "string" (for vector paths),
      "cornerRadius": number (for rectangles),
      "parentContainer": "frame" | "group" (optional, defaults to frame)
    }
  ]
}

For MODIFY operations, only include the properties that should be changed. Omit properties that should remain unchanged.

IMPORTANT: Use the exact numerical values from the plan. All coordinates are relative to the parent container (frame or group).

